pragma solidity ^0.6.6;

import {NetworkAgnostic} from "./common/NetworkAgnostic.sol";

contract HoldMoney is NetworkAgnostic {
    //minimum wei for hold one event
    uint256 amountGuardETH = 10000000000000000000;
    address public owner;
    uint256 public priceEth;
    uint256 public priceToken;

    struct quizeHolder {
        address payable hostWallet;
        uint256 money;
        bool tokenType;
        int256 question_id;
    }

    struct quizeAmount {
        uint256 amount;
        mapping(uint256 => quizeHolder) holder;
    }

    mapping(address => quizeAmount) qAmount;

    constructor() NetworkAgnostic("Public_contract", "1", 5) public {
        owner = msg.sender;
    }

    function _setMoneyRetention(bool _tokenType, int256 question_id, address payable wallet)
        public
        payable
        returns(uint256)
    {
        uint256 amount = moneyRetentionCalculate(_tokenType, wallet);
        uint256 index = qAmount[wallet].amount + 1;
        qAmount[wallet].holder[index].hostWallet = wallet;
        qAmount[wallet].holder[index].money = amount;
        qAmount[wallet].holder[index].tokenType = _tokenType;
        qAmount[wallet].holder[index].question_id = question_id;
        qAmount[wallet].amount ++;
        return amount;
    }

    function _getMoneyRetention(address payable _host) public payable returns(uint256, address, bool, int256) {
        require(msg.sender == owner, "Only owner can execute this function");
        require(qAmount[_host].amount > 0, "Do not have coins on account");

        uint256 index = qAmount[_host].amount;
        address payable host = qAmount[_host].holder[index].hostWallet;

        require(host == _host, "Addresses not equal");
        uint256 money = qAmount[_host].holder[index].money;
        qAmount[host].amount--;
        bool path = qAmount[_host].holder[index].tokenType;
        int256 question_id = qAmount[_host].holder[index].question_id;
        delete qAmount[_host].holder[index];
        return (money, host, path, question_id);
    }

    function moneyRetentionCalculate(bool _tokenType, address payable wallet) public view returns (uint256) {
        return moneyCalc(qAmount[wallet].amount + 1, _tokenType);
    }

    function onHold(address wallet) public view returns (uint256) {
        if (qAmount[wallet].amount >= 1) {
            uint256 value = 0;
            for (uint8 i = 1; i <= qAmount[wallet].amount; i++) {
                bool path = qAmount[wallet].holder[i].tokenType;
                value = value + moneyCalc(i, path);
            }
            return value;
        } else {
            return 0;
        }
    }

    function moneyCalc(uint256 number, bool _tokenType) private view returns (uint256) {
        uint256 value = amountGuardETH;
        if (number == 1) {
            if(_tokenType){
                return (value / priceEth) * 100;
            } else {
                return ((value / priceToken) * 100) / 2;
            }
        } else if (number >= 2) {
            for (uint8 i = 1; i < number; i++) {
                value = value + value;
            }
            if(_tokenType){
                return (value / priceEth) * 100;
            } else {
                return ((value / priceToken) * 100) / 2;
            }
        }
    }

    function _amountGuard(bool _tokenType, uint256 balanceToken, address payable wallet) public view returns (int8) {
        if (balanceToken >= moneyRetentionCalculate(_tokenType, wallet)) {
            // don't have any errors
            return 0;
        } else {
            // host does not have enough money
            return 1;
        }
    }

    function setEthPrice(uint256 _priceEth, uint256 _priceToken) public {
        require(msg.sender == owner, "only owner can change price");
        priceEth = _priceEth / 1000000000000000000;
        priceToken = _priceToken / 1000000000000000000;
    }

    function _msgSender() internal view returns (address payable sender) {
        if(msg.sender == address(this)) {
            bytes memory array = msg.data;
            uint256 index = msg.data.length;
            assembly {
                // Load the 32 bytes word from memory with the address on the lower 20 bytes, and mask those.
                sender := and(mload(add(array, index)), 0xffffffffffffffffffffffffffffffffffffffff)
            }
        } else {
            sender = msg.sender;
        }
        return sender;
    }
}
